const input = ''

/**
 * Need to increase the max call stack size for it to run: /bin/bash -c "ulimit -s 65500; exec node --stack-size=65500 ./5.js"
 */

const removeNextReactivePair = input => {
  let result = input
  for (let i = 0; i < input.length - 1; i++) {
    const current = input.charAt(i)
    const next = input.charAt(i + 1)

    if (Math.abs(current.charCodeAt(0) - next.charCodeAt(0)) === 32) {
      result = input.slice(0, i) + input.slice(i + 2)
      return removeNextReactivePair(result)
    }
  }

  if (result === input) return result
}

console.log(removeNextReactivePair(input).length)

